/**
 * Manages the UI ready state to receive data.
 * If the UI is not visible then the sate is suspended else it is active.
 * This is activly used to manage remote datasource data fetching and rendering
 * @type {{active: string, suspended: string}}
 */
export const ComponentUiStates = {
    empty: "empty",
    suspended: "suspended",
    active: "active"
}